$(document).ready(function() {
	override_documentPageLoad_event();
});

function override_documentPageLoad_event() {
	jcrop_event();
}

function jcrop_event() {

	$('#cropbox_event').Jcrop({
		setSelect:   [ 0, 0, 600, 100 ],
		aspectRatio: 1.4,
		onSelect: updateCoords_event,
		onChange: updateCoords_event
	});
}

function updateCoords_event(coords) {
	$('#event_crop_x').val(coords.x)
	$('#event_crop_y').val(coords.y)
	$('#event_crop_w').val(coords.w)
	$('#event_crop_h').val(coords.h)
};
// Place all the behaviors and hooks related to the matching controller here.
// All this logic will automatically be available in application.js.

$(document).ready(function() {
  	override_documentPageLoad_faqs();
});

$(document).on('turbolinks:load', override_documentPageLoad_faqs);


function override_documentPageLoad_faqs() {
  	sortable_faq_rows();
}


// SORT
function sortable_faq_rows() {

	var currentlyScrolling = false;

	var SCROLL_AREA_HEIGHT = 40;

	$( "#sortable_faq_rows tbody" ).sortable({
		update: function(e, ui) {

			console.log( $(this).sortable('serialize') )

			data_url = $('#sortable_faq_rows').data("url");

     		item_id = ui.item.data('item-id');
     		position = ui.item.index();

     		// alert(item_id);
     		// alert(position);

			$.ajax({
  				type: 'PATCH',
  				url: data_url,
  				dataType: 'json',
  				data: { id: item_id, faq: { row_order_position: position } }
			});
		}
	});
}

$(document).on('page:load', override_documentPageLoad_faqs);
// Place all the behaviors and hooks related to the matching controller here.
// All this logic will automatically be available in application.js.
// Place all the behaviors and hooks related to the matching controller here.
// All this logic will automatically be available in application.js.
$(document).ready(function() {
	override_documentPageLoad_image();
});

function override_documentPageLoad_image() {
	jcrop_image();

	remove_images();
	add_image();

	$('body').on('click','[data-toggle="collapse"][data-target^="$("]',function() {
		alert("CLICK");
		eval($(this).data('target')).collapse('toggle');

	});
}

function jcrop_image() {

	$('#cropbox_image').Jcrop({
		setSelect:   [ 0, 0, 600, 100 ],
		aspectRatio: 1.4,
		onSelect: updateCoords_image,
		onChange: updateCoords_image
	});
}

function updateCoords_image(coords) {
	$('#image_crop_x').val(coords.x)
	$('#image_crop_y').val(coords.y)
	$('#image_crop_w').val(coords.w)
	$('#image_crop_h').val(coords.h)
};



function remove_images() {
	return $('form').on('click', '.remove_image_fields', function(event) {
		$(this).prev('input[type=hidden]').val('1');
		$(this).closest('fieldset').hide();
		return event.preventDefault();
	});
}

function add_image() {
	$('form').on('click', '.add_image_fields', function(event) {
		var regexp, time;
		time = new Date().getTime(); // to make it unique
		regexp = new RegExp($(this).data('id'), 'g');
		$("#image-card-body").append($(this).data('fields').replace(regexp, time));
		return event.preventDefault();
	});
}

$(document).on('page:load', override_documentPageLoad_image);
$(document).ready(function() {
  override_documentPageLoad();
});

// $(document).on('page:load', override_documentPageLoad);
// $(document).on('page:change', override_documentPageLoad);
$(document).on('turbolinks:load', override_documentPageLoad);

function override_documentPageLoad() {
	// alert('here');

	// font awesome
	FontAwesome.dom.i2svg();

	// select 2
	$('.select2-multiple').select2({
		// theme: "bootstrap4"
		placeholder: 'Please select:',
		width: '100%'
	});

	// .select2({ width: '100%' });

	$('.select2-multiple-tags').select2({
		placeholder: 'Please select:',
		tags: true,
		allowClear: true,
		width: '100%'
	});

	$('.select2-multiple-images').select2({
		templateResult: formatImage,
		placeholder: 'Please select:',
		width: '100%'
	});

	$('.datepicker').datepicker({
		// format: 'mm/dd/yyyy',
		format: 'yyyy-mm-dd'
	});


	$('.custom-file-input').on('change', function() { 
   		let fileName = $(this).val().split('\\').pop(); 
   		$(this).next('.custom-file-label').addClass("selected").html(fileName); 
	});
}

function formatImage (image) {

	if (!image.id || !$(image.element).attr("image_url")) {
		return image.text;
	}
	var imagUrl = $(image.element).attr("image_url")
	var $image = $('<span><img src="' + imagUrl + '" class="" /> ' + image.text + '</span>');
	return $image;
}
