function jcrop_news() {

	$('#cropbox_news').Jcrop({
		setSelect:   [ 0, 0, 600, 100 ],
		aspectRatio: 1.4,
		onSelect: updateCoords_news,
		onChange: updateCoords_news
	});
}

function updateCoords_news(coords) {
	$('#news_crop_x').val(coords.x)
	$('#news_crop_y').val(coords.y)
	$('#news_crop_w').val(coords.w)
	$('#news_crop_h').val(coords.h)
};
