$(document).ready(function() {
	override_documentPageLoad_tabs();
});

$(document).on('turbolinks:load', override_documentPageLoad_tabs);

function override_documentPageLoad_tabs() {

	remove_tabs();
	add_tab();


	$('body').on('click','[data-toggle="collapse"][data-target^="$("]',function() {
		
		eval($(this).data('target')).collapse('toggle');
		// eval( $(this).data('target') ).toggle();
	});
}

function remove_tabs() {
	return $('form').on('click', '.remove_tab_fields', function(event) {
		$(this).prev('input[type=hidden]').val('1');
		$(this).closest('fieldset').hide();
		return event.preventDefault();
	});
}

function add_tab() {
	$('form').on('click', '.add_tab_fields', function(event) {
		var regexp, time;
		time = new Date().getTime(); // to make it unique
		regexp = new RegExp($(this).data('id'), 'g');
		// $(this).before($(this).data('fields').replace(regexp, time));
		$("#tab-card-body").append($(this).data('fields').replace(regexp, time));
		
		return event.preventDefault();
	});
}

$(document).on('page:load', override_documentPageLoad_tabs);
// Place all the behaviors and hooks related to the matching controller here.
// All this logic will automatically be available in application.js.
$(document).ready(function() {
  	override_documentPageLoad_users();
});

$(document).on('turbolinks:load', override_documentPageLoad_users);

function override_documentPageLoad_users() {
 
  	level_change_handler( $('#user_level').find(":selected").text());
  	$( "#user_level" ).change(function() {
  		level_change_handler( $('#user_level').find(":selected").text());
  	});

  	// disabled checkbox values are not posted on a form submit
  	// HACK: enable (remove disabled option) from all checkboxes before form submit
  	$(".edit_user").submit(function() {
    	$("input").removeAttr("disabled");
	});
}



function level_change_handler(level) {

	// $( "#user_websites_container").css( "visibility", "visible");
	// $( "#user_websites_container" ).show();
	// $( "#user_websites_container" ).fadeIn();

	if(level == "basic") {
		// websites selection
		// $("#user_website_ids").prop("disabled", true);
		$("#user_website_ids").prop("disabled", false);
		// $(".select2-selection__rendered").css( "visibility", "hidden");
		$(".select2-selection__rendered").css( "visibility", "visible");
		
		// permissions selection
		// websites
		$("#user_websites_admin").prop("checked", false );
		$("#user_websites_admin").prop("disabled", true);
		// website groups
		$("#user_website_groups_admin").prop("checked", false );
		$("#user_website_groups_admin").prop("disabled", true);
		// people
		$("#user_people_admin").prop("checked", false );
		$("#user_people_admin").prop("disabled", true);
		// courses
		$("#user_course_admin").prop("checked", false );
		$("#user_course_admin").prop("disabled", true);
		// news
		$("#user_news_admin").prop("checked", false );
		$("#user_news_admin").prop("disabled", true);
		// events
		$("#user_events_admin").prop("checked", false );
		$("#user_events_admin").prop("disabled", true);
		// job
		$("#user_job_admin").prop("checked", false );
		$("#user_job_admin").prop("disabled", true);
		// page
		$("#user_page_admin").prop("checked", false );
		$("#user_page_admin").prop("disabled", true);

	} else if(level == "admin") {
		// websites selection
		$("#user_website_ids").prop("disabled", false);
		$(".select2-selection__rendered").css( "visibility", "visible");

		// permissions selection
		$("#user_websites_admin").prop("disabled", false); // websites
		$("#user_website_groups_admin").prop("disabled", false); // website groups
		$("#user_people_admin").prop("disabled", false); // people
		$("#user_course_admin").prop("disabled", false); // courses
		$("#user_news_admin").prop("disabled", false); // news
		$("#user_events_admin").prop("disabled", false); // events
		$("#user_job_admin").prop("disabled", false); // job
		$("#user_page_admin").prop("disabled", false); // page
		
	} else if(level == "super") {
		// websites selection
		$("#user_website_ids").prop("disabled", true);
		$(".select2-selection__rendered").css( "visibility", "hidden");

		// permissions selection
		// websites
		$("#user_websites_admin").prop("checked", true );
		$("#user_websites_admin").prop("disabled", true);
		// website groups
		$("#user_website_groups_admin").prop("checked", true );
		$("#user_website_groups_admin").prop("disabled", true);
		// people
		$("#user_people_admin").prop("checked", true );
		$("#user_people_admin").prop("disabled", true);
		// courses
		$("#user_course_admin").prop("checked", true );
		$("#user_course_admin").prop("disabled", true);
		// news
		$("#user_news_admin").prop("checked", true );
		$("#user_news_admin").prop("disabled", true);
		// events
		$("#user_events_admin").prop("checked", true );
		$("#user_events_admin").prop("disabled", true);
		// job
		$("#user_job_admin").prop("checked", true );
		$("#user_job_admin").prop("disabled", true);
		// page
		$("#user_page_admin").prop("checked", true );
		$("#user_page_admin").prop("disabled", true);
	}
}


$(document).on('page:load', override_documentPageLoad_users);
