$(document).ready(function() {
    overiride_application_lod();
});


function overiride_application_lod() {

	init_sidebar();
	nav_scroll();
}

function nav_scroll() {

	if ($( "#navbar" ).hasClass( "trans" )) {

	    window.addEventListener('scroll', function(e) {

	    	if ($( "#navbar" ).hasClass( "trans" )) {
		        // if (document.documentElement.scrollTop > 100 ) {
		        if (document.scrollingElement.scrollTop > 100 ) {
		            if ($( "#navbar" ).hasClass( "ewt-navbar-trans" )) {
		                $( "#navbar" ).removeClass( "ewt-navbar-trans" );
		                $( "#nav-item" ).removeClass( "nav-item-trans" );
		                $( "#nav-brand" ).removeClass( "navbar-brand-trans" );
		                $( "#header-auth-btn" ).removeClass( "btn-header-trans" );
		                $( "#header-logo" ).removeClass( "header-logo-text-trans" );
		            }
		        } else {
		            if (!$( "#navbar" ).hasClass( "ewt-navbar-trans" )) {
		                $( "#navbar" ).addClass( "ewt-navbar-trans" );
		                $( "#nav-item" ).addClass( "nav-item-trans" );
		                $( "#nav-brand" ).addClass( "navbar-brand-trans" );
		                $( "#header-auth-btn" ).addClass( "btn-header-trans" );
		                $( "#header-logo" ).addClass( "header-logo-text-trans" );
		            }
		        }
		    }
	    });	   
	} 
}

function init_sidebar() {

	var slideout = new Slideout({
		'panel': document.getElementById('main'),
		'menu': document.getElementById('menu'),
		'padding': 256,
		'tolerance': 100,
		'side': 'right'
	});

	document.querySelector('.js-slideout-toggle').addEventListener('click', function() {
		slideout.toggle();
	});

	document.querySelector('.menu').addEventListener('click', function(eve) {
		if (eve.target.nodeName === 'A') { slideout.close(); }
	});

	slideout.on('beforeopen', function() {
		document.querySelector('.fixed').classList.add('fixed-open-right');
	});

	slideout.on('beforeclose', function() {
		document.querySelector('.fixed').classList.remove('fixed-open-right');
	});
}

$(document).on('turbolinks:load', overiride_application_lod);
